import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const Services=()=> {
  return (
    <>
       
     {  Sdata.map((val,index)=>{
         
         return 
                  <Card 
                  imgsrc={val.imgsrc}

                  title={val.title}
                    
                    />
             
  
            })
  
     }

    </>
  );
}

export default Services;
